import { Component, OnInit } from '@angular/core';
import { StudentService } from 'src/app/services/students/student.service';
import { TeacherService } from 'src/app/services/teacher/teacher.service';
import { InstitutionsService } from 'src/app/services/institutions/institutions.service';
import { CoursesService } from 'src/app/services/courses/courses.service';
import { AssignService } from 'src/app/services/assign/assign.service';

declare var jsPDF: any;

@Component({
  selector: 'app-reports',
  templateUrl: './reports.component.html',
  styleUrls: ['./reports.component.css']
})
export class ReportsComponent implements OnInit {

  constructor(public studentService: StudentService,
    public teacherService: TeacherService,
    public instService: InstitutionsService,
    public courseService: CoursesService,
    public assignService: AssignService) { }

  ngOnInit() {
  }

  generateStudent() {
    this.studentService.getStudents().
      subscribe(res => {
        var columns = [{header: 'Carné'}, {header: 'Nombre'}, {header: 'Apellido'}, {header: 'Fehca de Nacimiento'}, {header: 'CUI'}, {header: 'Teléfono'}, {header: 'Dirección'}, {header: 'Cursos Asignados'}];
        var data = this.getStudentAsArray(res);
        this.generateReport(columns, data, 'Students', 'landscape');
      });
  }

  generateInst() {
    this.instService.getInstitutions().
      subscribe(res => {
        var columns = [{header: 'Código'}, {header: 'Nombre'}];
        var data = this.getDataAsArray(res);
        this.generateReport(columns, data, 'Instituciones', 'p');
      });
  }

  generateCourse() {
    this.courseService.getCourses().
      subscribe(res => {
        var columns = [{header: 'Intitución'}, {header: 'Código'}, {header: 'Nombre'}, {header: 'Profesor'}];
        var data = this.getCourseAsArray(res);
        this.generateReport(columns, data, 'Cursos', 'p');
      });
  }

  generateTeacher() {
    this.teacherService.getTeachers()
      .subscribe(res => {
        var columns = [{header: 'Código'}, {header: 'Nombre'}, {header: 'Apellidos'}, {header: 'Fecha de Nacimiento'}, {header: 'CUI'}, {header: 'Especialidad'}];
        var data = this.getTeacherAsArray(res);
        this.generateReport(columns, data, 'Profesores', 'landscape');
      });
  }

  generateAsignation() {
    this.assignService.getAssign()
      .subscribe(res => {
        var columns = [{header: 'Estudiante'}, {header: 'Curso Assignado'}, {header: 'Sección'}];
        var data = this.getDataAsArray(res);
        this.generateReport(columns, data, 'Asignaciones', 'p');
      });
  }

  generateReport(columns, data, name, pos) {
    var doc = new jsPDF(pos, 'pt', 'legal');
    doc.text('Reporte de '+name, 40, 50);
    doc.autoTable(columns, data,{margin: { top: 65 }});
    doc = this.addWaterMark(doc);
    doc.save(name + '.pdf');
  }

  getStudentAsArray(res) {
    var data = [];
    var a = Object.values(res);
    for (let i = 0; i < a.length; i++) {
      data[i] = [];
      var student = JSON.parse(JSON.stringify(a[i]));
      data[i][0] = student._id;
      data[i][1] = student.name;
      data[i][2] = student.lastName;
      data[i][3] = student.fnac;
      data[i][4] = student.cui;
      data[i][5] = student.tel;
      data[i][6] = student.address;
      data[i][7] = '';
      for (let j = 0; j < student.course_asigned.length; j++) {
        if (j == student.course_asigned.length - 1) {
          data[i][7] += student.course_asigned[j].name + '.';
        } else {
          data[i][7] += student.course_asigned[j].name + ', ';
        }
      }
    }
    return data;
  }

  getCourseAsArray(res) {
    var data = [];
    var a = Object.values(res);
    for (let i = 0; i < a.length; i++) {
      data[i] = [];
      var course = JSON.parse(JSON.stringify(a[i]));
      data[i][0] = course.cod_inst.name;
      data[i][1] = course.cod_course;
      data[i][2] = course.name;
      data[i][3] = course.cod_teacher.name +' '+ course.cod_teacher.lastName;
    }
    return data;
  }

  getTeacherAsArray(res) {
    var data = [];
    var a = Object.values(res);
    for (let i = 0; i < a.length; i++) {
      data[i] = [];
      var prof = JSON.parse(JSON.stringify(a[i]));
      data[i][0] = prof._id;
      data[i][1] = prof.name;
      data[i][2] = prof.lastName;
      data[i][3] = prof.fnac;
      data[i][4] = prof.cui;
      data[i][5] = prof.esp; 
    }
    return data;
  }

  getDataAsArray(res) {
    var data = [];
    var a = Object.values(res);
    for (let i = 0; i < a.length; i++) {
      data[i] = Object.values(a[i]);
      data[i].pop();
      data[i].shift();
    }
    return data;
  }

  addWaterMark(doc) {
    const imgdata = 'data:image/png;base64,';
    var totalPages = doc.internal.getNumberOfPages();
    for (let i = 1; i <= totalPages; i++) {
      doc.setPage(i);
      doc.setTextColor(150);
      doc.addImage(imgdata, 'PNG', doc.internal.pageSize.width - 130, 20, 32, 32);
      doc.text(doc.internal.pageSize.width - 100, 42, 'Brainsco');
    }
    return doc;
  }

}
